import ExpenseItem from './ExpenseItem'

function App() {
  const expeuses = [
    {
      date: new Date('March 23, 2024'),
      title: 'Car Insurance',
      price: 294.35
    },
     {
      date: new Date('April 23, 2024'),
      title: 'Home Insurance',
      price: 300.35
    },
  ]
  return (
       <div>
      <h2>Let's get started!</h2>
      <ExpenseItem props={ expeuses[0] } />
      <ExpenseItem props={ expeuses[1] } />
    </div>
  );
}

export default App;
